import React, { Component } from 'react'
import {Navbar,Nav,NavItem,Form,NavDropdown,Button,FormControl} from 'react-bootstrap';
import {Link } from 'react-router-dom';
import './CustomNavbar.css'

export default class CustomNavbar extends Component {
    render() {
        return (
         

            <Navbar expand="lg" collapseOnSelect>
            <Navbar.Brand href="#home" stye={{color:'white'}}>Sereal Koding</Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav ">
              <Nav className="mr-auto">
                <Nav.Link eventKey={1} componentClass={Link} to="/">Home</Nav.Link>
                <Nav.Link eventKey={2} componentClass={Link} to="/about">About</Nav.Link>
                <Nav.Link  eventKey={3} componentClass={Link} to="/news" >News</Nav.Link>
              </Nav>
              {/* <Form inline>
                <FormControl type="text" placeholder="Search" className="mr-sm-2" />
                <Button variant="outline-success">Search</Button>
              </Form> */}
            </Navbar.Collapse>
          </Navbar>
           
        )
    }
}
